import React from 'react';

const Impressum = () => {
  return (
    <div >
      <h1>Impressum</h1>
      <p>
        Bacon ipsum dolor amet meatball shankle biltong chislic. Turkey meatloaf prosciutto tongue bresaola t-bone. Turducken andouille brisket fatback, pork belly ground round beef ribs ham pork loin chicken. Pancetta strip steak t-bone chicken tail boudin doner jerky fatback shoulder turducken ground round landjaeger.
        </p>
    </div>
  );
}

export default Impressum;
